import React from "react";
import styled from "styled-components";
import {
  Container,
  SubHeader,
  SubText,
  Text,
  CaptionText,
} from "../../styledComponents";
import { Avatar, Divider } from "@material-ui/core";
import MailIcon from "@material-ui/icons/Mail";
import BathroomIcon from "@material-ui/icons/BathTub";
import BedIcon from "@material-ui/icons/KingBed";
import GardenIcon from "@material-ui/icons/AmpStories";
import CarIcon from "@material-ui/icons/DirectionsCar";
import GraphIcon from "@material-ui/icons/ShowChart";
import ViewIcon from "@material-ui/icons/Style";
import CheckIcon from "@material-ui/icons/CheckCircleOutline";

const Tag = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  border-radius: 20px;
  background-color: #e1e1e1;
  padding: 4px 15px;
  margin: 0px 5px;
`;

const ProfileTab = () => {
  return (
    <Container flex={1} column customStyles={{ paddingTop: 30 }}>
      <Container
        color="white"
        flex={0}
        row
        customStyles={{ padding: "20px 10px", borderRadius: 4 }}
      >
        <Container middle center flex={0.08} color="transparent">
          <CheckIcon color="green" style={{ fontSize: 25 }} />
        </Container>
        <Container column middle flex={0.72} color="transparent">
          <Text customStyles={{ fontWeight: "600" }}>Tenant is Active</Text>
          <CaptionText>Tenant is active since a year ago</CaptionText>
        </Container>
        <Container middle center flex={0.2} color="transparent">
          <Container
            row
            middle
            wrap
            center
            customStyles={{
              padding: "6px 15px",
              backgroundColor: "green",
              borderRadius: 50,
            }}
          >
            <CaptionText customStyles={{ color: "white" }}>
              Deactivate
            </CaptionText>
          </Container>
        </Container>
      </Container>
      <Container
        color="transparent"
        flex={0}
        row
        customStyles={{ padding: "20px 10px" }}
      >
        <Container
          color="white"
          flex={1}
          row
          customStyles={{ padding: "20px 10px", borderRadius: 4 }}
        >
          <CheckIcon color="green" style={{ fontSize: 25 }} />
        </Container>
        <Container
          color="white"
          flex={0}
          row
          customStyles={{ padding: "20px 10px", borderRadius: 4 }}
        >
          <Text customStyles={{ fontWeight: "600" }}>Tenant is Active</Text>
          <CaptionText>Tenant is active since a year ago</CaptionText>
        </Container>
      </Container>
    </Container>
  );
};

export default ProfileTab;
